export default {
  props: ['Exception'],
  methods: {
    gounnormal(item) {
      let url1 = item.Videos[0].VideoUrl;
      let url2 = item.Videos[1].VideoUrl;
      let remark = item.Remark;
      let jobName = item.JobName;
      let createAt = item.CreateAt;
      let createBy = item.CreateBy;
      this.$router.push({
        path: "/unnormal",
        query: {
          'url1': url1,
          'url2': url2,
          'remark': remark,
          'jobName': jobName,
          'createAt': createAt,
          'createBy': createBy
        }
      });
    }

  }
};
